    return (
        <>
            <div id="home-wrapper">
                <img className='logo-image' src={UTFPRLOGO} alt=""/>
                <p className='title-app'>Mapeamento de Salas do Campus Campo Mourao</p>
                <center>

                </center>
            </div>
            <Footer/>
        </>
    )
}

export default Home;
